import logo from './Nielsenlogo.jpg';
import React,{useState} from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import './App.css';
import InfiniteLoadingList from 'react-simple-infinite-loading'

export default function ScrollableList() {
 const items = [{'id': 'id1','message':'message1'},{'id': 'id2','message':'message2'},{'id': 'id3','message':'message3'},{'id': 'id1','message':'message1'},{'id': 'id2','message':'message2'},{'id': 'id3','message':'message3'},{'id': 'id1','message':'message1'},{'id': 'id2','message':'message2'},{'id': 'id3','message':'message3'},{'id': 'id1','message':'message1'},{'id': 'id2','message':'message2'},{'id': 'id3','message':'message3'}]
  return (
      <div style={{backgroundColor:"blue"}}>
        <InfiniteLoadingList
        items={items}
        itemHeight={40}
        hasMoreItems={false}
        loadMoreItems={true}
      >
        {({ item }) => <div style={{width:50,height:50}}>{item.message}</div>}
      </InfiniteLoadingList>
      </div>
  );
}
